/*!40000 ALTER TABLE `tbl_pbb_detail_contributor` ENABLE KEYS */;
UNLOCK TABLES;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'STRICT_ALL_TABLES,NO_AUTO_CREATE_USER' */ ;
DELIMITER ;;
/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trig_tbl_pbb_detail_contributor_before_update` BEFORE UPDATE 
ON `tbl_pbb_detail_contributor` FOR EACH ROW
BEGIN

	--	
	SET NEW.pbb_contributor_t_message = NULL;
	
	--	TARGET
	IF NEW.pbb_contributor_applicable = "Y"
		AND (NEW.pbb_contributor_target <> 0
		OR NEW.pbb_contributor_target IS NOT NULL) THEN
		
        --	NUMBER (SUM - 1): 
		IF (SELECT mfo_question_online_computation_du_cu_summary
			FROM tbl_mfo_questions
			WHERE mfo_question_id = NEW.mfo_question_id) = 1 THEN
		
			--	DROP DECIMAL IF INT
			IF NEW.pbb_contributor_target - FLOOR(NEW.pbb_contributor_target) > 0 THEN
				SET NEW.pbb_contributor_t_message = "This PI expects a number, decimal was dropped.";
			END IF;
			SET NEW.pbb_contributor_target = FLOOR(NEW.pbb_contributor_target);
		
        --	PERCENT (AVG - 2):
		ELSEIF (SELECT mfo_question_online_computation_du_cu_summary
			FROM tbl_mfo_questions
			WHERE mfo_question_id = NEW.mfo_question_id) = 2 THEN
			--	CLEAR PI IF OVER 100%
			IF NEW.pbb_contributor_target > 100 THEN
				SET NEW.pbb_contributor_target = NULL;
			END IF;
		--	PGH NO. OF WEEKS WAITING PERIOD (AVG - 3):
		ELSE
			SET NEW.pbb_contributor_t_message = NULL;
		END IF;
	END IF;
    
    --	IF APPLICABLE ID N
	IF NEW.pbb_contributor_applicable = "N" 
		AND NEW.pbb_contributor_applicable <> OLD.pbb_contributor_applicable THEN
		--	SET TARGET TO NULL IF NOT APPLICABLE
		SET NEW.pbb_contributor_target = NULL;
		SET NEW.pbb_contributor_t_remarks = NULL;
		SET NEW.pbb_contributor_t_message = NULL;
	END IF;
	
	--	ACCOMPLISHMENT

END */;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'STRICT_ALL_TABLES,NO_AUTO_CREATE_USER' */ ;
DELIMITER ;;
/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trig_tbl_pbb_detail_contributor_after_update` AFTER UPDATE 
ON `tbl_pbb_detail_contributor` FOR EACH ROW
BEGIN

	IF NEW.pbb_contributor_target > 0 THEN
	
		IF (SELECT mfo_question_online_computation_du_cu_summary
			FROM tbl_mfo_questions
			WHERE mfo_question_id = NEW.mfo_question_id)= 1 THEN
			--	NUMBER (SUM - 1)
			UPDATE tbl_pbb_detail_delivery SET
				pbb_delivery_target = (SELECT SUM(Target)
										FROM frm_7_t_sa_pbb_detail_contributor
										WHERE pbb_delivery_id = NEW.pbb_delivery_id)
			WHERE pbb_delivery_id = NEW.pbb_delivery_id;
		ELSE
			--	FOR PERCENT
			UPDATE tbl_pbb_detail_delivery SET
				pbb_delivery_target = (SELECT AVG(Target)
										FROM frm_7_t_sa_pbb_detail_contributor
										WHERE pbb_delivery_id = NEW.pbb_delivery_id)
			WHERE pbb_delivery_id = NEW.pbb_delivery_id;			
		END IF;
		
	END IF;

END */;;
DELIMITER ;
