	-- Edit trigger body code below this line. Do not edit lines above this one
BEGIN

	IF NEW.unit_contributor_name <> OLD.unit_contributor_name THEN
    
		--	REFLECT UPDATES TO tbl_pbb_detail
		UPDATE tbl_pbb_detail_contributor SET
            unit_contributor_name = NEW.unit_contributor_name 
		WHERE unit_contributor_id = NEW.unit_contributor_id;
        
		UPDATE tbl_users SET
            unit_contributor_name = NEW.unit_contributor_name 
		WHERE unit_contributor_id = NEW.unit_contributor_id;
        
	END IF;
    
    IF NEW.unit_contributor_name <> OLD.unit_contributor_name 
		OR NEW.unit_contributor_name_short <> OLD.unit_contributor_name_short THEN
        
		UPDATE tbl_sd_users SET
            unit_contributor_name = NEW.unit_contributor_name 
            , unit_contributor_name_short = NEW.unit_contributor_name_short
		WHERE unit_contributor_id = NEW.unit_contributor_id;
        
	END IF;

	--	DELETE MFO QUESTIONS IF YOU FIND AN N VALUE
	--	-------------------------------------------
	IF NEW.unit_contributor_mfo_1 = 'N' AND OLD.unit_contributor_mfo_1 <> NEW.unit_contributor_mfo_1 THEN 
		CALL proc_trig_tbl_units_con_update_tbl_pbb_detail_con_no(NEW.unit_contributor_id, 1);
	ELSEIF NEW.unit_contributor_mfo_1 = 'Y' AND OLD.unit_contributor_mfo_1 <> NEW.unit_contributor_mfo_1 THEN
		CALL proc_trig_tbl_units_con_update_tbl_pbb_detail_con_yes(NEW.unit_contributor_id, 1);
	END IF;

	IF NEW.unit_contributor_mfo_2 = 'N' AND OLD.unit_contributor_mfo_2 <> NEW.unit_contributor_mfo_2 THEN 
