	ELSEIF NEW.unit_contributor_mfo_2 = 'Y' AND OLD.unit_contributor_mfo_2 <> NEW.unit_contributor_mfo_2 THEN
		CALL proc_trig_tbl_units_con_update_tbl_pbb_detail_con_yes(NEW.unit_contributor_id, 2);
	END IF;

	IF NEW.unit_contributor_mfo_3 = 'N' AND OLD.unit_contributor_mfo_3 <> NEW.unit_contributor_mfo_3 THEN 
		CALL proc_trig_tbl_units_con_update_tbl_pbb_detail_con_no(NEW.unit_contributor_id, 3);
