	ELSEIF NEW.unit_contributor_mfo_4 = 'Y' AND OLD.unit_contributor_mfo_4 <> NEW.unit_contributor_mfo_4 THEN
		CALL proc_trig_tbl_units_con_update_tbl_pbb_detail_con_yes(NEW.unit_contributor_id, 4);
	END IF;

	IF NEW.unit_contributor_mfo_5 = 'N' AND OLD.unit_contributor_mfo_5 <> NEW.unit_contributor_mfo_5 THEN 
