BEGIN

	--	UPDATE UNITS TABLES FOR DELIVERY AND CONTRIBUTOR
    UPDATE tbl_units_delivery SET
		focal_person_id = NEW.focal_person_id
        , cu_sequence = NEW.cu_sequence
        , cu_short_name = NEW.cu_short_name
	WHERE cu_id = NEW.cu_id;
    
	UPDATE tbl_units_contributor SET
		focal_person_id = NEW.focal_person_id
        --	, cu_sequence = NEW.cu_sequence
        , cu_short_name = NEW.cu_short_name
	WHERE cu_id = NEW.cu_id;

	--	UPDATE PBB RECORDS FOR DELIVERY AND CONTRIBUTOR
	UPDATE tbl_pbb_detail_delivery SET
		focal_person_id = NEW.focal_person_id
        , cu_sequence = NEW.cu_sequence
        , cu_short_name = NEW.cu_short_name
	WHERE cu_id = NEW.cu_id;
    
	UPDATE tbl_pbb_detail_contributor SET
		focal_person_id = NEW.focal_person_id
        --	, cu_sequence = NEW.cu_sequence
        , cu_short_name = NEW.cu_short_name
	WHERE cu_sequence = NEW.cu_sequence;

	--	UPDATE USERS TABLES FOR MAIN AND SD
	UPDATE tbl_users SET
		focal_person_id = NEW.focal_person_id
        --	, cu_sequence = NEW.cu_sequence
        , cu_short_name = NEW.cu_short_name
	WHERE cu_id = NEW.cu_id;
    
	UPDATE tbl_sd_users SET
		focal_person_id = NEW.focal_person_id
        --	, cu_sequence = NEW.cu_sequence
        , cu_short_name = NEW.cu_short_name
	WHERE cu_id = NEW.cu_id;
	
	UPDATE tbl_cutoffdate SET
		focal_person_id = NEW.focal_person_id
        , focal_person_office = NEW.focal_person_office
	WHERE cu_id = NEW.cu_id;

END */;;
