/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER trig_tbl_units_stage_after_insert AFTER INSERT
ON tbl_units_stage 
FOR EACH ROW
BEGIN
	--	COPY FIELDS TO tbl_units_delivery
	IF NEW.unit_type = "delivery" OR NEW.unit_type = "both" THEN
		INSERT INTO tbl_units_delivery ( 
		  unit_delivery_id
		, focal_person_id
		, cu_id
		, cu_sequence

		, cu_short_name
		, unit_delivery_name_cu
		, unit_delivery_name
		, unit_delivery_name_short
		, unit_delivery_personnel_count
		, unit_delivery_mfo_1
		, unit_delivery_mfo_2
		, unit_delivery_mfo_3
		, unit_delivery_mfo_4
		, unit_delivery_mfo_5
		, unit_delivery_sto
		, unit_delivery_gass_ab
		, unit_delivery_gass_cd
		, unit_delivery_gass

		, cutOffDate_id
		, t_startDate
		, t_cutOffDate_fp
		, t_cutOffDate_remarks)
		SELECT 
		  A.unit_stage_id
		, B.focal_person_id
		, B.cu_id
		, B.cu_sequence

		, A.cu_short_name
		, CONCAT(A.cu_short_name, " - ", A.unit_delivery_name) 
		, A.unit_delivery_name
		, A.unit_name_short							--	ADDED FOR ATTACHMENT NAMING CONVENTION
		, A.personnel_count
		, A.mfo_1
		, A.mfo_2
		, A.mfo_3
		, A.mfo_4
		, A.mfo_5
		, A.sto
		, A.gass_ab
		, A.gass_cd
		, A.gass

		, C.cutOffDate_id
		, C.t_startDate
		, C.t_cutOffDate_fp
		, C.t_cutOffDate_remarks
		FROM tbl_units_stage AS A
		LEFT JOIN tbl_units_cu AS B
		ON A.cu_short_name = B.cu_short_name
		LEFT JOIN tbl_cutoffdate AS C
		ON B.focal_person_id = C.focal_person_id
		WHERE (NEW.unit_type = "delivery" 
			OR NEW.unit_type = "both")
			AND A.unit_stage_id = NEW.unit_stage_id;

	END IF;

	--	COPY FIELDS TO tbl_units_contributor
	IF NEW.unit_type = "contributor" OR NEW.unit_type = "both" THEN
		INSERT INTO tbl_units_contributor ( 
		  unit_contributor_id
		, unit_delivery_id
		, focal_person_id
		, cu_id
		, cu_short_name
		, unit_delivery_name_cu

		, unit_contributor_name
		, unit_contributor_name_short
		, unit_contributor_personnel_count
		, unit_contributor_mfo_1
		, unit_contributor_mfo_2
		, unit_contributor_mfo_3
		, unit_contributor_mfo_4
		, unit_contributor_mfo_5
		, unit_contributor_sto
		, unit_contributor_gass_ab
		, unit_contributor_gass_cd
		, unit_contributor_gass

		, cutOffDate_id
		, t_startDate
		, t_cutOffDate_fp
		, t_cutOffDate_remarks
		, a_startDate
		, a_cutOffDate_contributor)
		SELECT 
		  A.unit_stage_id
		, B.unit_delivery_id
		, B.focal_person_id
		, B.cu_id
		, A.cu_short_name
		, B.unit_delivery_name_cu

		, A.unit_contributor_name
		, A.unit_name_short							--	ADDED FOR ATTACHMENT NAMING CONVENTION
		, A.personnel_count
		, A.mfo_1
		, A.mfo_2
		, A.mfo_3
		, A.mfo_4
		, A.mfo_5
		, A.sto
		, A.gass_ab
		, A.gass_cd
		, A.gass

		, B.cutOffDate_id
		, B.t_startDate
		, B.t_cutOffDate_fp
		, B.t_cutOffDate_remarks
		, C.a_startDate
		, C.a_cutOffDate_contributor
		FROM tbl_units_stage AS A
		LEFT JOIN tbl_units_delivery AS B
		ON (A.cu_short_name = B.cu_short_name
			AND A.unit_delivery_name = B.unit_delivery_name)
		LEFT JOIN tbl_cutoffdate AS C
        ON B.cutOffDate_id = C.cutOffDate_id
		WHERE (NEW.unit_type = "contributor" 
			OR NEW.unit_type = "both")
			AND A.unit_stage_id = NEW.unit_stage_id;
			
		--	USED TO UPDATE DELIVERY UNITS TABLE
		INSERT INTO tbl_units_contributor_stage ( 
		  unit_contributor_id
		, unit_delivery_id
		, unit_delivery_name_cu
		, unit_contributor_name
		, unit_contributor_mfo_1
		, unit_contributor_mfo_2
		, unit_contributor_mfo_3
		, unit_contributor_mfo_4
		, unit_contributor_mfo_5
		, unit_contributor_sto
		, unit_contributor_gass)
		SELECT 
		  A.unit_stage_id
		, B.unit_delivery_id
		, B.unit_delivery_name_cu
		, A.unit_contributor_name
		, IF(A.mfo_1 = "Y", 1, 0)
		, IF(A.mfo_2 = "Y", 1, 0)
		, IF(A.mfo_3 = "Y", 1, 0)
		, IF(A.mfo_4 = "Y", 1, 0)
		, IF(A.mfo_5 = "Y", 1, 0)
		, IF(A.sto = "Y", 1, 0)
		, IF(A.gass = "Y", 1, 0)
		FROM tbl_units_stage AS A
		LEFT JOIN tbl_units_delivery AS B
		ON (A.cu_short_name = B.cu_short_name
			AND A.unit_delivery_name = B.unit_delivery_name)
		WHERE (NEW.unit_type = "contributor" 
			OR NEW.unit_type = "both")
			AND A.unit_stage_id = NEW.unit_stage_id;
			
	END IF;

	--	COPY FIELDS TO tbl_users
	IF NEW.unit_type = "contributor" OR NEW.unit_type = "both" THEN
		INSERT INTO tbl_users ( 
		  users_id
		, unit_contributor_id
		, unit_delivery_id
		, focal_person_id
		, cu_id
		, cu_short_name
		, unit_delivery_name_cu
		, unit_contributor_name
		, users_userLoginName
		, users_password
		, users_userLevel
		)		
		SELECT 
		  A.unit_stage_id 
		, B.unit_contributor_id
		, B.unit_delivery_id
		, B.focal_person_id
		, B.cu_id
		, A.cu_short_name
		, B.unit_delivery_name_cu
		, A.unit_contributor_name
		, SUBSTRING(MD5(RAND()) FROM 1 FOR 6)
		, SUBSTRING(MD5(RAND()) FROM 1 FOR 8)
		, 1
		FROM tbl_units_stage AS A
		LEFT JOIN tbl_units_contributor AS B
		ON (A.cu_short_name = B.cu_short_name
			AND A.unit_contributor_name = B.unit_contributor_name)
		WHERE (NEW.unit_type = "contributor" 
			OR NEW.unit_type = "both")
			AND A.unit_stage_id = NEW.unit_stage_id;
	ELSE
		INSERT INTO tbl_users ( 
		  users_id
--		, unit_contributor_id
		, unit_delivery_id
		, focal_person_id
		, cu_id
		, cu_short_name
		, unit_delivery_name_cu
		, unit_contributor_name
		, users_userLoginName
		, users_password
		, users_userLevel
		)		
		SELECT 
		  A.unit_stage_id 
--		, B.unit_contributor_id
		, B.unit_delivery_id
		, B.focal_person_id
		, B.cu_id
		, A.cu_short_name
		, B.unit_delivery_name_cu
		, A.unit_contributor_name
		, SUBSTRING(MD5(RAND()) FROM 1 FOR 6)
		, SUBSTRING(MD5(RAND()) FROM 1 FOR 8)
		, 2
		FROM tbl_units_stage AS A
		LEFT JOIN tbl_units_delivery AS B
		ON (A.cu_short_name = B.cu_short_name
			AND A.unit_delivery_name = B.unit_delivery_name)
		WHERE NEW.unit_type = "delivery"
			AND A.unit_stage_id = NEW.unit_stage_id;
	END IF;
	
	--	COPY FIELDS TO tbl_sd_users
	IF NEW.unit_type = "contributor" OR NEW.unit_type = "both" THEN
		INSERT INTO tbl_sd_users ( 
		  sd_users_id
		, unit_contributor_id
		, unit_delivery_id
		, focal_person_id
		, cu_id
		, cu_short_name
		, unit_delivery_name_cu
		, unit_delivery_name_short
		, unit_contributor_name
		, unit_contributor_name_short
		, sd_users_username
		, sd_users_password
		, cutOffDate_id
		, t_startDate
		, a_cutOffDate_contributor
		, a_cutOffDate_delivery
		, a_cutOffDate_fp
		, a_cutOffDate_remarks
		)		
		SELECT 
		  A.unit_stage_id
		, B.unit_contributor_id
		, B.unit_delivery_id
		, B.focal_person_id
		, B.cu_id
		, A.cu_short_name
		, B.unit_delivery_name_cu
		, D.unit_delivery_name_short
		, A.unit_contributor_name
		, E.unit_contributor_name_short
		, B.users_userLoginName
		, B.users_password
		, C.cutOffDate_id
		, C.t_startDate
		, C.a_cutOffDate_contributor
		, C.a_cutOffDate_delivery
		, C.a_cutOffDate_fp
		, C.a_cutOffDate_remarks
		FROM tbl_units_stage AS A
		LEFT JOIN tbl_users AS B
		ON (A.unit_stage_id = B.users_id)
		LEFT JOIN tbl_cutoffdate AS C
		ON (B.focal_person_id = C.focal_person_id)
		LEFT JOIN tbl_units_delivery AS D
		ON (B.unit_delivery_id = D.unit_delivery_id)
		LEFT JOIN tbl_units_contributor AS E
		ON (B.unit_contributor_id = E.unit_contributor_id)
		WHERE A.unit_stage_id = NEW.unit_stage_id;
	END IF;
	
END */;;
