/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER trig_tbl_users_before_insert BEFORE INSERT
ON tbl_users 
FOR EACH ROW
BEGIN

	-- APPEND CU PREFIX
	SET NEW.users_userLoginName = CONCAT(NEW.cu_short_name , NEW.users_userLoginName);
	
