		OR NEW.users_nameFirst IS NOT NULL
		OR NEW.users_nameMiddle IS NOT NULL THEN
		SET NEW.users_name = CONCAT_WS(' ', CONCAT(NEW.users_nameLast, ", "), NEW.users_nameFirst, NEW.users_nameMiddle);
	END IF;

END */;;
